import styles from "./Header.module.css";

const Header = () => {
   return (
      <header>
         <div>
            <img src='' alt='' />
            <h1>Fashion</h1>
         </div>
         <div>
            <nav>
               <ul>
                  <li>Catalogue</li>
                  <li>Fashion</li>
                  <li>Favourite</li>
                  <li>Lifestyle</li>
               </ul>
            </nav>
            <button>Sign up</button>
         </div>
      </header>
   );
};

export default Header;
